import React from 'react';
import './style.css';
import '../../global.css';

import logoImg from '../../assets/foto-perfil.png';


export default function Home() {
    return (
        <div className="home-container">
           <section className="perfil">
            <img src={logoImg} alt="Developer"/>
            <h2>Kaique Feng</h2>
            <p>I'm Frontend Developer</p>

            <button className="button">Conhecer</button>
            <button className="button-contato">Contato</button>
           </section>
        </div>
    )
}
